import React from 'react';
import './index.css';
import SlotMach from './SlotMach';

const Appp = () => {
    return(
        <>
        <h1 className="heading_style">Welcome to <span style={{fontWeight: "bold"}}> Slot Machine Game </span>
        </h1>
        <div className="slotmachine">
        <SlotMach x="one"  y="one" z="two"/> 
        <SlotMach x="one"  y="two" z="two"/> 
        <SlotMach x="one"  y="one" z="one"/> 
        </div>
        </>
    );
    
};
 export default Appp;
